I wouldn’t say I like to toot my own horn, and if you know me, you know I’m telling the truth, but I’ll say this: I’ve made a lasting impact on how bands present themselves to the world. 

@jukebox_media has worked our butts off over the years to achieve what you see daily on YouTube and other social media sites. To have a MAJOR brand like @sigmaphoto buy into me, the media team and the program speaks volumes about what we create every weekend. 

You can check out the full interview by hitting the link in @sigmaphoto bio! The best is still YET to come! #JukeboxMedia #TheStandardIsTheStandard
